import './MyDream.css';

function MyDream({dream}) {

  return ( 
    <div className="myDream__container">
      <dutton className='myDream__deleteBTN'></dutton>
      <img className="myDream__img" 
        alt = {dream.name} 
        src = {dream.link}
      />
    </div>
  );
}

export default MyDream;
